import React from 'react';
import './App.css';

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      username: '',
      password: '',
    }
  }

  render() {
    return(
      <div className="App">
        <label>
          Username:<input label="Username" type="text" value={this.state.username} onChange={window.alert("Hi", this.state.username)}></input>
        </label>
        <br></br>
        <br></br>
        <label>
          Password:<input label="Password" type="password" value={this.state.password} onChange={console.log("Working")}></input>
        </label>
        <br></br>
        <br></br>
        <button type="submit">Login</button>
      </div>
    );
  }
}

export default App;
